Crown Commercial Service as the Authority awarded a Pan Government Framework Agreement for use by UK public sector bodies.

The Framework Agreement will provide Public Sector Bodies with Project Management and Full Design Team Services as part of a multi-disciplinary team, or to call off individual disciplines, as required. 

The duration of this Framework Agreement is for a two (2) year period with two (2) options to extend, each for a period of one (1) year in duration, up to a maximum four (4) year term in total.

The Framework Agreement will be divided into six (6) Lots:

- Lot 1 - Multi-Disciplinary Services;

- Lot 2 - Project Management Services; 

- Lot 3 - Architectural Services;

- Lot 4 - Cost Management Services;

- Lot 5 - Civil & Structural Engineering Services; and

- Lot 6 - Building Services Engineering.

The City invites Tenders for the provision of Decent Homes works to Avondale Square Estate (Phase II).
The project comprises of: 
(i) the refurbishment of kitchens, bathrooms and central heating systems;	
(ii) all associated builders work and repairs, including plastering, plumbing, carpentry and re-painting;
In accordance with the Government's Decent Homes Programme.

The duration of the contract is outlined in the programme provided, subject to the right of the Authority (at its sole discretion).

Closed opportunity - published specification:
We are looking for external providers to help us to develop an engaging programme of activities to support and encourage more pupils from the target areas into Higher Education and to help us meet the overall targets for the NCOP project which are:
- 95 % of project participants moving into KS4 make an informed choice for GCSE options;
- 95 % of project participants moving into KS5 make informed post-16 choices;
- 95 % of project participants leaving KS5 make informed post-18 choices;
- Achieve a 2 % uplift across our partner schools/academies/colleges in numbers who progress to an HE destination.
During the lifetime of the project we aim to reach over 10 000 learners.

Guildford Borough Council is seeking a lively and experienced community engagement consultant to help integrate Guildford Museum with its community.  We want to go beyond public consultation, and occasional partnership projects, to develop our role as community facilitators and collaborators.  This will transform the way we work and our organisational culture.
      
      We've a great professional team who are excited by this opportunity but need expert help in researching and developing an engagement strategy and action plan, together with on-going support in directing and driving this transformation forward.  This includes equipping the team with new skills and the confidence to work in ways to develop an outward-facing museum.   
      
      We are seeking to appoint an experienced engagement consultant to work closely with us to develop and deliver our project.  This will be over a period of approximately 16 months, acting as an expert advisor, trailblazer, mentor and critical friend.  Our objectives for this consultancy are:
      
      o To identify and develop opportunities for the Museum to embed itself within its community and foster local involvement;
      o To assist in developing and building capability in the team to enable organisational and cultural change;
      o To support the Heritage Team in reaping maximum benefit and insights from project activities and the Resilience grant;
      o To support and complement work on the Museum Development Project to create a special museum for Guildford.
